import React from 'react';
import { Box, Grid, Paper, Card, CardMedia, CardContent, Typography, Avatar, makeStyles } from '@material-ui/core';
import ClientAvatar from '../../Images/Avatar.svg'

const TestimonialCard = (props) => {
    return (
        <>
            <Grid item lg={4} md={4} sm={4} xs={12}>
                <div className="d-flex align-items-center flex-column text-center">
                    <Avatar imgProps={{ style: { borderRadius: "50%" } }} src={ClientAvatar} style={{ height: "8rem", width: "8rem", border: "1px solid grey", padding: ".3rem", margin: "1rem 0" }} />
                    <Typography variant="h6">Lorem ipsum dolor sit amet consectetur adipisicing elit. Debitis nostrum porro quae hic officia mollitia aliquid veniam earum aut error.</Typography>
                    <Box mt={2}>
                        <Typography variant="h5">{props.clientName}</Typography>
                    </Box>
                </div>
            </Grid>
        </>
    )
}

export default TestimonialCard;
